import {
  HeaderTitle,
  CustomTable,
  CustomModal,
  openNotification,
  CustomDrawer,
  CustomDrawerButton
} from "./";
const { Content } = Layout;
const PersonalContent = () => {
  const [drawerVisible, setDrawerVisible] = useState();
  // custom Drawer
  const showDrawer = () => {
    setDrawerVisible(true);
  };
  const onhandleAdd = async items => {
    // await addDishes(items);
  };

  const onClose = () => {
    setDrawerVisible(false);
  };

  //   first_name: first_name,
  //             last_name: last_name,
  //             gender: gender,
  //             address: address,
  //             password: password,
  //             phone_number: phone_number,
  //             work_position: work_position,
  //             age: age,
  //             salary: salary,
  //             email: loginEmail[0],
  //             date: date,

  return (
    <Fragment>
      <Content style={{ margin: "2em 16px" }}>
        <div style={{ background: "#fff", padding: 24, minHeight: 280 }}>
          <HeaderTitle title="Personal Menu" />
          <CustomDrawerButton title="Add" showDrawer={showDrawer} />
          <CustomDrawer
            personal={true}
            title="Add Personal"
            visible={drawerVisible}
            onClose={onClose}
            onhandleAdd={onhandleAdd}
            firsItem={"First Name"}
            secondItem={"LastName "}
            thirdItem={"Gender"}
            fourthItem={"Address"}
            fiveItem={"Password"}
            sixItem={"Phonenumber"}
            sevenItem={"Work Position"}
            eightItem={"Age"}
            nineItem={"Salary"}
            tenItem={"EMail"}
            elevenItem={"Date"}
          />
        </div>
      </Content>
    </Fragment>
  );
};

export { PersonalContent };
